A common way to handle exception is to throw a new exception with some information to indicate where might go wrong. For example, private static int divide() { int x, y; try { x = getInt(); // a self-defined method that can get input from typing the keyboard. y = getInt(); return x / y; } catch (NoSuchElementException e) { throw new NoSuchElementException("no suitable input"); } catch (ArithmetricException e) { throw new ArithmetricException("attempt to divide by zero"); } } Alternatively, we could catch multiple exception in the main methods, such as private static void main (String[] args) { try { int result = divide(); } catch (ArithmetricException | NoSuchElementException e) { // it is not logical symbol or System.out.println(e.toString); System.out.println("Unable to excute, the computer shutting down"); }
} When Java code throws an exception, the runtime looks up the stack for a method that has a handler (like catch) that can process it. If it finds one, it passes the exception to it. If it doesn't, the program exists. No matter whether an exception occur in try-block or not, finally will ALWAYS be excuted. For example, // Java program to demonstrate control flow of try-catch-finally clause
// when exception occur in try block but not handled in catch block
class GFG { public static void main (String[] args) { // array of size 4. int[] arr = new int[4]; try { int i = arr[4]; // this statement will never execute // as exception is raised by above statement System.out.println("Inside try block"); } // not a appropriate handler so the following statement will also not execute catch(NullPointerException ex) { System.out.println("Exception has been caught"); } finally { // will execute System.out.println("finally block executed"); } // rest program will not execute System.out.println("Outside try-catch-finally clause"); }
} However, if NullPointerException was replaced by ArrayIndexOutOfBoundsException, the correct exception, the statement in the catch will execute. Even if there is a return in try block, the finally statement will also be excuted. private static int printAnumber () { try { return 3; } catch (Exception e) { return 4; } finally { return 5; } // output: 5, becauase the finally statement will override the above statement.
}

